import React from 'react';
import './checkboxes.module.scss';

const hobbies = [
    { value: 'Спортзал' },
    { value: 'Кальян' },
    { value: 'Диван' },
];

const music = [
    { value: 'Тяжелый рок', },
    { value: 'Русский рэп', },
    { value: 'Евроденс', },
];

const food = [
    { value: 'Мясоед', },
    { value: 'Сидит на ПП', },
    { value: 'Веган-сыроед', },
];

function Checkboxes() {

    return (
        <div className="filters__holder checkboxes">
            <ul className="checkboxes__list">
                {hobbies.map(({ value }) => (
                    <li className="checkboxes__item checkbox" key={value}>
                        <label className="checkbox__label">
                            <p>{`${value}`}</p>
                            <input
                                className="checkbox__input"
                                type="checkbox"
                                value={value}
                                name={value}
                            />
                            <span className="checkbox__toggle-icon" tabIndex={0}></span>
                        </label>
                    </li>
                ))}
            </ul>
            <ul className="checkboxes__list">
                {music.map(({ value }) => (
                    <li className="checkboxes__item checkbox" key={value}>
                        <label className="checkbox__label">
                            <p>{`${value}`}</p>
                            <input
                                className="checkbox__input"
                                type="checkbox"
                                value={value}
                                name={value}
                            />
                        </label>
                    </li>
                ))}
            </ul>
            <ul className="checkboxes__list">
                {food.map(({ value }) => (
                    <li className="checkbox__item checkbox" key={value}>                        
                            <label className="checkbox__label">
                                <p>{`${value}`}</p>
                                <input
                                    className="checkbox__input"
                                    type="checkbox"
                                    value={value}
                                    name={value}
                                />
                            </label>                        
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Checkboxes;
